import './App.css';
import NavBar from './navbar.jsx'
import Pricing from './pages/pricing'
import Home from './pages/home'
import About from './pages/about'

function App() {
let Component
  switch (window.location.pathname) {
    case "/":
      Component = App
      break
    case "/pricing":
      Component = Pricing
      break
    case "/about":
      Component = About
      break
  }
  return (
      <header className="page-background">
        <div className="title">
          Ryan's Workshop
        </div >

        <NavBar/>

        <Component/>

      </header>
  );
}

export default App;
